      const layers = svg
        .selectAll(".layer")

        .attr("class", "layer");

        .selectAll(".node")

        .attr("class", "node")
        .attr("transform", d => `translate(${d.x0},${d.y0})`)
        .on("mouseover", tooltip.onMouseOver)
        .on("mousemove", tooltip.onMouseMove)
        .on("mouseleave", tooltip.onMouseLeave)
        .on("click", (event, d) => {
          if (d === selectedNode) {
            updateChart();
          } else {
            updateChart(d);
          }
        });
      //fill node groups
      const rect = nodeGroups
        .selectAll("rect")
        .data(d => [d])
        .join("rect")
        .attr("id", d => d.nodeUid.id)
        .attr("fill", d => color(d).backgroundColor)
        .attr("rx", 2)
        .attr("ry", 2)
        .attr("width", d => d.x1 - d.x0)
        .attr("height", d => d.y1 - d.y0)
        .style("stroke", null)
        .attr("stroke-width", null);

      if (selectedNode != null) {
        rect
          .filter(d => d === selectedNode)
          .style("stroke", "#fff")
          .attr("stroke-width", 2);
      }

      // add clipPath so text do not go out of node
      nodeGroups
        .selectAll("clipPath")
        .data(d => [d])
        .join("clipPath")
        .attr("id", d => d.clipUid.id)
        .selectAll("use")
        .data(d => [d])
        .join("use")
        .attr("xlink:href", d => d.nodeUid.href);

      // add text with clipping
      const text = nodeGroups
        .selectAll("text")
        .data(d => [d])
        .join("text")
        .attr("clip-path", d => d.clipUid)
        .style("fill", d => color(d).fontColor);

      text
        .selectAll("tspan")
        .data(d => [d.data.name, format_1(d.originalValue)])
        .join("tspan")
        .attr("fill-opacity", (d, i, nodes) =>
          i === nodes.length - 1 ? 0.7 : null
        )
        .style("font-size", "0.7em")
        .text(d => d);

      nodeGroups
        .filter(d => d.children)
        .selectAll("tspan")
        .attr("dx", 3)
        .attr("y", 13);

      nodeGroups
        .filter(d => !d.children)
        .selectAll("tspan")
        .attr("x", 3)
        .attr(
          "y",
          (d, i, nodes) => `${(i === nodes.length - 1) * 0.3 + 1.1 + i * 0.9}em`
        );

      tooltip.buildCache(nodeGroups, {
        getNodeSize: d => d.originalValue,
        totalSize: root.originalValue,
        nodes,
        links
      });
    };

    updateChart();
  };

  return drawChart;
